import React from "react";
import "./styles.css";
import expect from "expect";

export default function App() {


   const counter = (state = 0, action) => {
      switch (action.type) {
         case 'INCREMENT':
            return state + 1;
         case 'DECREMENT':
            return state - 1;
         default:
            return state;
      }
   }

   return (
    <div className="App">
      <h1>Hello World</h1>
      <h2>Do stuff.</h2>
       <p>And things.</p>
       <p>And more things.</p>
    </div>
  );
}
